import math
class BinaryMatrix():
    def __init__(self, binaryMatrix):
        self.binaryMatrix = binaryMatrix
        self.cnt = 0
    def get(self, x: int, y: int) -> int:
       self.cnt += 1
       if self.cnt > 1000:
           while True:
               print("TLE")
               break
       return self.binaryMatrix[x][y]
    def dimensions(self):
       return [len(self.binaryMatrix), len(self.binaryMatrix[0])]



class Solution:
    def leftMostColumnWithOne(self, binaryMatrix: 'BinaryMatrix') -> int:
        # binary search is time O(logN) for each row, and then time O(NlogN) for all element
        dimension = binaryMatrix.dimensions()
        nr = dimension[0]
        nc = dimension[1]
        self.binaryMatrix = binaryMatrix
        minIndex = 101
        for i in range(nr):
            result = self.BinarySearch(1, i, 0, nc - 1)
            # print(result)
            if result < minIndex:
                minIndex = result
        return minIndex if minIndex < 101 else -1

    def BinarySearch(self, x, i, p, r):
        low = p
        high = r

        index = float('inf')
        while low <= high:
            mid = math.floor((low + high) / 2)
            if x == self.binaryMatrix.get(i, mid):
                index = min(index, mid)
                high = mid - 1
            else:
                low = mid + 1

        return index

